INSERT INTO [stl].[Translation] ([LanguageId], [TranslationCodeId], [Value]) VALUES (7, 564, N'All changes, such as editing or deleting pigeon time by breaking the rules, made after the close of flight, will log and visible to all users. From now any speculation, any deliberate interference in the results.')
INSERT INTO [stl].[Translation] ([LanguageId], [TranslationCodeId], [Value]) VALUES (8, 564, N'Всі зміни, наприклад, редагування часу чи видалення голуба за порушення правил, зроблені після закриття польоту, логуються і видимі для всіх користувачів. Від тепер жодних спекуляцій, жодного умисного втручання в результати.')
INSERT INTO [stl].[Translation] ([LanguageId], [TranslationCodeId], [Value]) VALUES (7, 565, N'Do you have questions or proposals? Then write here')
INSERT INTO [stl].[Translation] ([LanguageId], [TranslationCodeId], [Value]) VALUES (8, 565, N'Маєте питання або пропозиції? Тоді пишіть сюди')
